`]})]})]}),`
`,n.jsx(e.p,{children:"There were quite a few ideas for new spell types and AI behaviors, but many of them were discarded in favor of a smaller scope."}),`
`,n.jsx(e.p,{children:"Some of these include:"}),`
`,n.jsxs(e.ul,{children:[`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Passive abilities"}),": Auras that provide temporary buffs or debuffs to allies/enemies, slowly draining mana."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Informational spells"}),": Shows outlines of nearby enemies or pickups."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Configurable loadouts"}),": The ability for players to adjust their spell properties to fine tune damage/mana costs, etc."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"True AI roles"}),": Rather than just states, I wanted to explore a more complex AI system that supported roles and task allocation."]}),`
`]}),`
`,n.jsx(e.h3,{children:"Why CTF?"}),`
`,n.jsx(e.p,{children:"Capture-the-flag gave me built-in tactical layers: route guarding, trap setting, flanking, and defending. In contrast, a deathmatch setup would've pushed players toward brute-force damage racing. For bots, CTF also created clearer roles -- attacking, defending, escorting -- which aligned with my AI goals."}),`
`,n.jsx(e.h3,{children:"Spell System Design"}),`
