`,n.jsx(e.p,{children:'I wanted to test how FPS design changes when direct-damage weapons are de-emphasized in favor of abilities that manipulate space, timing, and information. Capture-the-flag provides a natural structure for that -- it forces teamwork, creates evolving objectives, and gives bots a reason to coordinate beyond just "shoot the enemy."'}),`
